(15, 'Reviews Rei Pilates', 85, '', 'From R. Restrepo\r\nI recently took a class at Rei Pilates and loved it!! The instructor was so friendly and patient with everyone. She made the class challenging yet enjoyable. And the studio was great also. It felt very new and clean. I even bought a couple cute tops on my way out. Highly recommend it!!\r\n\r\n\r\nFrom M.B. Raju\r\nJust had a class with Rei this morning.  She\'s fantastic!  \r\n\r\nI am not someone who loves to work out, yet ever since I started going to Rei Pilates a few months ago, I find myself coordinating my calendar around how many times I can get there in a week.  Something about the tone and vibe of the place (and Rei herself) is energizing.\r\n\r\nThe workout is awesome.  I\'ve take pilates at numerous other studios and Rei\'s classes are the best.  Her techniques and moves are fun, efficient, and effective.  She switches it up and has you do just enough reps where you feel it working without pushing it to be painful and unpleasant.  I\'ve seen more results going to her classes for 6 months than I have in years of going to other studios.  And she plays great music which makes the time fly by! \r\n\r\nThe studio itself is clean, modern and bright.  She has the new reformers which are sleeker and easier to use than the chunky older ones at other places.  (She also stocks the cutest athletic clothes, which are fun to browse after a good workout.) Highly recommend!', '2017-05-16', 1, '2017-06-18 22:30:17', '2017-05-16 04:07:28', 1),
