(29, 'Website Edits', 34, '', 'a.	The contact details, which appear in the left top of the page are in anemic grey color and can\'t be noticed. This should be presented much brighter, so it would be easily noticed,  maybe should be in \"our\" blue\r\nb.	The font of the word \"MiniOmni\" is kind of gross and does not comply with BeamMed\'s font (which is normally, if I\'m not wrong – Calibri) \r\nc.	Below the MiniOmni – the word \"accurate\" should be replaced with \"affordable\" \r\nd.	\"only hand-held\" – please add \"the\" before \"only\"\r\ne.	The main photo in the top of the page – please consider switching periodically with the blond girl next to the desk with the MiniOmni and the laptop (she appears in the Sunlight MiniOmni – Adults Configuration)\r\nf.	In the bottom of the page, \" More About The MiniOmni Portable Bone Density\" – we suggest adding \"device\" / \"solution\" at the end of this sentence. \r\ng.	On the right to the clip at the bottom of the page – \" Sunlight MiniOmni™ is an ultra-small device that can bring a huge benefit to osteoporosis diagnosis and monitoring\" – the word \"screening\" is missing. This is the most important buzzword we use…\r\nh.	Furthermore – \" it delivers accurate bone density measurements\" – we don’t do bone density measurements (nor does anyone else). We do bone density assessments (this is a regulatory restriction) ', '2017-05-30', 1, '2017-06-02 17:13:02', '2017-05-30 12:21:12', 1),
