(42, 'Add Reviews To Website', 119, '', 'They do an amazing job. We converted all our old VHS-c to DVDs. Nice people too!\r\nJan Glenum\r\n\r\nI had a great experience, the job is very professional, good price and amazing service.\r\nExtremely recommended!!!\r\nMeny Avraham\r\n\r\nAbsolutely awesome service, I was completely satisfied with the result and the DVD turned out great. Excellent customer service, I will definitely come again. Thank you!!\r\nMelissa Gonzalez\r\n\r\nJust wanted to thank you for an awesome job! I had Tapes in Pal format from my childhood that I haven\'t watched for 15 years. All my memories are there. I didn\'t trust big companies to do the job as i was afraid it could be lost or sth. I was glad to deal with a owner of a small local business, Harold completed order in 10 days. How awesome is that ?!\r\nJennifer Gross Tuschman\r\n\r\nHarold did an amazing job. My sister passed away a couple years ago and I stumbled across some old VHS tapes of her on a Saturday night around midnight. I emailed him and he responded within 30 minutes. That was the fastest I\'ve seen a business respond after hours. He instructed me to call that Sunday before 1pm as I did so arrived there with the tapes and he had them converted by 330pm on the same day. He manage to convert them a week before Christmas and I am thankful for what business he provided which allowed me to see my sister once again bringing back all the memories.\r\nJimmy Alexander,Jr.\r\n\r\nThanks Harold for your excellent customer service on my Living Social offer to convert some VHS tapes. We had some nice chats about the tapes, and you even repaired one that didn\'t quite survive the conversion process. I look forward to doing business with you in future and in fact am sending more tapes today to take advantage of your April special.\r\nLissa Johnston\r\n\r\nI sent 20 of my VHS tapes via mail to have them converted to dvds. I was contacted when he received them and also when he sent them back. I was very happy with the work done and am grateful to HB media solutions for taking such good care of my videos. I will definitely use him again. \r\nAnn O\'Sullivan\r\n\r\nHB Media Solutions is a top notch company. Harold contacted us to discuss the series of the movies to DVD and did an excellent job in converting them for us. Several family members and friends have also expressed an interest in having HB Media Solutions convert some old memories for them. They are a great company to deal with and yes we would use them again.\r\nRaymond Wycoff\r\n\r\nBeautifully done, carefully packaged and wonderful to be able to see the home movies after such a long time since I had been able to view them on the obsolete tapes. I am very satisfied, and enjoying getting to watch these again. Despite the long wait it was well worth it.\r\nPatricia Dryer\r\n\r\nHarold was professional throughout the entire process. He explained the process from A to Z and delivered on everyone of his promises. I needed them back to me by a certain date, (my daughters Confirmation) and they were delivered 5 days prior to that date. The entire family enjoyed the DVD\'S during the party. I have already recommended HB to several family members and friend. I know consider Harold a friend and hope to go to a Yankee game with him THANK YOU HAROLD AND THANK YOU ANGIE\'S LIST!!!\r\njohn mulcahy', '2017-06-28', 1, '2017-11-27 01:47:19', '2017-06-27 21:49:21', 1),
