INSERT INTO `review` (`id`, `review_description`, `office_id`, `is_active`, `created_at`, `updated_at`) VALUES
(1, 'Every year we have a private party at our clubhouse and DJ Jon always makes it a blast. We appreciate the great job and as always keeping the party going. We highly recommend DJ Jammin\' Jon for any event.', 2, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(2, 'Great quality workout gloves. They seem to really last well compared to my previous gloves. Found them online and now my wife wants a pair of the pink workout gloves. Nice to see gloves in new colors other than black and white with real leather.', 7, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(3, 'Great quality movers.  We were referred to them from our Realtor and had them come out for a written estimate as I had no idea how much it costs to move. They were not the cheapest moving quote we got but we needed the reassurance of quality which seemed to be lacking from the other movers in the area. We have a Steinway piano that has been in our family for over 50 years and they specialized in this as well as antiques. After the move I was extremely happy their wasn\'t any damage and they took the time for a perfect move.  Thanks again.', 5, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(4, 'Working with Funtastic DJs was really great. They gave us a few different djs to choose form based on our music styles. Then we had a meeting with dj sean garrity where he played for us and he was receptive to our feedback. A week before the wedding we had a call with him to discuss our song requests and walk through the schedule of events. On the day of he showed up on time and had everyone on the dance floor all night. Great wedding DJ, highly recommend.', 3, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(5, 'Very happy with my toro workout gloves. Bought them about 2 months ago and they hande wear and tear great. Fits my hands perfect.', 7, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(6, 'Great experienced DJ provided top-notch entertainment at our private event. Will only deal with Sean from now on for our events. Thanks again.', 3, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(7, 'Excellent carpet cleaning company. They came on time and did a wonderful job and on carpet. They gave me a quote for the tile cleaning and I decided to get that done as well. They came a couple of days later and also did a great job on the tile. I was very impressed. I would definitely use them again and recommend them.', 8, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(8, 'Great Title Company. We bought a foreclosure for the first time and Nationwide Title stayed on schedule and help facilitate the process. Thanks again.', 9, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(9, ' I can\'t say enough good things about Jon. He did such an amazing job at my wedding. Kept the party going and made sure everyone was having a fantastic time. Photo booth was a hit with the guests and I love seeing the fabulous pictures. Thanks jon for an amazing wedding.', 2, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(10, 'I asked WW Web Design to design our company a web site and host it. The person who designed it is very professional and knowledgeable and was easy to work with. He was helpful and said even after the website was on google that they would be there for help. The service and even the after service is what counts with me and I am happy to deal with a company who does that. I have already recommended them to my friends. Good Work.', 10, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(11, 'Beautiful Pink Workout Gloves! I love them, thanks.', 7, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(12, 'Conti Roofing Repairs was extremely responsive to my needs - which included arriving when promised, reliably assessing the extent of the leak problem, and then performing a quality repair at a reasonable price.  The crew of about 5 exhibited a professional and friendly demeanor which was evidently cultured by the company\'s owner, Anthony Conti.  This family owned business is the one you should definitely consider.', 11, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(13, 'From beginning to end Conti Roofing Repairs Co. was honest and forthcoming. They did what they were supposed to do, at the time they said they would.\r\nTheir quality of work was excellent and prices were reasonable and fair. I was informed about every stage of the project and how they were going to perform it. A Licensed Roofing left nothing to chance, and I felt confident I made the right decision, after 3 months of research.\r\n', 12, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(14, 'The photo booth got rave reviews from our wedding guests. Friends and family had so much fun with the photo booth--they\'re still talking about the photos they took weeks after the wedding. We ordered the guest book, and it\'s well worth the extra money! We had almost 200 guests at our wedding, so it was hard to find time to chat with everyone, so the guest book was a great way for us to “connect” with guests we didn\'t get a chance to chat with in person. And, it was a ton of fun looking at everyone\'s photos, and the messages they had written, in the book the day after the wedding. 100% would recommend Sean Garrity DJ Events and Photobooth Rentals!', 3, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(15, 'Fast A/C repair. Called Top Tech A/C late on Saturday and was able to make it the next morning. Within an hour the technician was able to get the A/C blowing cold. He ended up doing a tuneup and threw in a discount from their online coupon. Thanks again Top Tech.', 14, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(16, 'Thanks Top Tech AC Repair! They helped us install a new condenser unit and made sure the seer size was matched, giving us a great savings on our electric bill. Thanks again and we look forward to seeing you guys again for our yearly AC tuneup.', 15, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(17, 'Loved the lunch buffet! Great place for that home cooked taste, Mediterranean style.', 16, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
