(120, 'We had a short move from Fort Lauderdale to Weston. We chose C & C Shipping because they were recommended by a friend, even though they were not the lowest in price. I found that the professionalism displayed was worth every penny. These guys were fast, courteous, and did everything possible to protect our stuff. We were amazed that the move was completed so quickly. We will be using them again next year. ', 6, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(121, 'Fantastic job on our home renovation. We wanted to upgrade the bathroom since we bought the house and Ediss worked out with us not only a great design but an affordable price without compromising quality.', 41, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(122, 'Great experience with C & C Movers. I moved from a four bedroom house that included 3 bedrooms, a home office and a very packed 2 car garage. I knew I had a lot of stuff, but still was overwhelmed on what came out of my cabinets and shelves. The 6 men crew that arrived took control and had things in order rather quick. Joel ensured everyone he knew what to do and kept looking into their progress during the day. They packed and labeled the boxes and left my old house with no scratch. C & C Shipping placed the furniture where I requested making sure I was happy with the final results before leaving. I know my move was fairly big and I was expecting a bit of a messy day. Gladly, they went beyond my expectations and delivered a fantastic, well trained crew that made certain everything was done smoothly.', 4, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(123, 'Our first renovation turned out perfect. We were recommended to ECO General Contractors from our realtor and had a great experience. After we moved in we realized how much we needed an additional bathroom. After the consultation with Pavel, we had confidence that we made a good decision. After it was done, we were surprised on how well it came out especially since we knocked down an additional wall for easier access. Thanks again.', 28, 0, '2017-06-18 20:50:12', '2017-03-28 07:23:11'),
(124, 'From the sales staff to the kitchen installers, all the people I dealt with were excellent, nice guys. They bent over backwards to explain the process and install the kitchen properly. I would recommend them to anyone and everyone.', 41, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(125, 'Again a great wood floor installation. This is our second time using US Hardwood Floor Company and always with good service. The choice of wood and color matches our home perfect, thanks.', 48, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(126, 'Another great service on our yacht. We find SN Yacht service to being not only reliable but very reasonably priced for their services.  Thanks.', 47, 0, '2018-01-11 13:01:03', '2017-03-28 07:23:11'),
(127, 'Had to ship using DHL at this location and had a great experience. Very friendly staff and easy to find.  Thanks.', 51, 0, '2017-06-30 16:03:25', '2017-03-28 07:23:11'),
(128, 'Was recommended and got great service. We needed a new A/C for quite some time and Top Tech A/C gave us a good deal on a new AC unit. We will recommend you to anyone needing air conditioning service.  Thanks.', 36, 0, '2018-07-03 15:03:53', '2017-03-28 07:23:11'),
(129, 'Bought a modular watermaker frpm Sea RO Watermakers and its running like a champ. Definitely recommend the quality design. ', 32, 0, '2018-01-11 13:03:04', '2017-03-28 07:23:11'),
(130, 'Great job moving us to our new home in Hollywood, fl. Guys came on time and performed their moving service very professional. Thanks again for doing a great job.', 52, 0, '2018-09-05 13:11:47', '2017-03-28 07:23:11'),
(131, 'Excellent job getting our A/C unit in shape. Thanks again for the professional air conditioning service and I will look forward to our yearly tune-up.', 36, 0, '2018-09-05 13:17:49', '2017-03-28 07:23:11'),
(132, 'Designed and remodeled our new kitchen with great success. We are very happy with the results and still keep getting comments on it. Thanks again for the hard work and well though out design.', 42, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(133, 'We just moved into our new house thinking the AC would be fine for years. Unfortunately, it suddenly wasn\'t blowing cold air anymore, and I didn\'t know anyone in the area because of moving here from out of state. Through a few searches I came across All County and I gave a quick call and was glad to reach someone after hours. Joe said he was still working and could run by my place after he finishes. I was very glad that he took the extra time to explain to me why a new ac unit was having this problem. He changed the filter, cleaned the coils and in about 2 hours, I was back to a cold air.', 53, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(134, 'Once again we had a great remodeling project completed. This is our second project with ECO General Contractors and always great service. We are extremely happy with our new room addition and the remodeling of the floors.', 28, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(135, 'Very friendly staff and great service. Thanks again.', 51, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(136, 'Upgrading our yacht watermaker was needed for some time. Works great and very efficient. Will definitely recommend.', 32, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(137, 'Great job on our complet renovation of our house. From the floor, kitchen and bathrooms we get so many comments on the modern look. I will recommend definitely.', 42, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(138, 'Had our new roof installation by Dadeland Roofing. Excellent job on the installation at a very affordable price.', 30, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(139, 'Did an excellent job on our home remodeling project. We changed the flooring, added another bathroom and upgraded our kitchen. Their team was efficient and worked hard.  We will definitely recommend you to our friends.', 42, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(140, 'Excellent and fast sliding glass door replacement. We recently had a break in and called the closest glass repair company, ABobs.  They came out within an hour and had the glass installed the same stop. Thanks again for being there when we need you.', 54, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(141, 'Excellent mobile spray tanning service. We tried it for the first time and had a great service.  Thanks again.', 50, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(142, 'Had a great experience with this title company. We used them for a recent home purchase, and found them to being very organized and professional. ', 9, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(143, 'The Sunlight Omnisense / Mini Omni Ultrasound Bone Sonometers (Beammed) are the first nonheel, non-invasive ultrasound device capable of measuring bone speed of sound (SOS) at one or more skeletal sites which reached sufficient level of validation to be used with sufficient liability according to current guidelines. \r\n\r\nAs today, with more than 12 years of positive track record, the Omnisense series gained international recognition and has been known as a reliable tool with excellent trueness and precision and as such has been used extensively in many countries in screening program. In conclusion, the primary clinical use of QUS Mini Omni is to identify, in conjunction with clinical risk factors, a population at very high fracture probability in which further disease management may be necessary.  \r\n', 34, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(144, ' Needed our storefront glass replaced and called Abobs. They were fast, professional and priced reasonable.', 54, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(145, 'South Florida Van Lines did a great job moving our Miami Beach office. After 4 days of moving, I found them to be very professional and well organized. Thanks again for the hard work.', 44, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(146, 'Excellent spray tanning service. Was recommended from a friend and had Cristina come to my house for a spray tan service. Very professional and will recommend.', 50, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(147, 'Had our bathroom remodeled by ECO General Contractors. Our project was completed on time within budget and was surprised on the quality work. Thanks again and I will recommend.', 28, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(148, 'We sold our house last month with the help of Nationwide Title. We ended up having problems with our title and they quickly resolved the issues. We are grateful for a hard working office and the help that they gave us to make sure our closing went smooth.', 21, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(149, 'Great job getting our window glass replaced on our home. Thanks again for the fast service.', 54, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(150, 'I truly cannot speak highly enough about Jose\'s preparedness, patience and insights. While my husband and I searched for an apartment, he was incredibly helpful; answering questions very quickly and accurately. Jose served a terrific sounding board as we discussed the merits and drawbacks for each listing he showed us. His accessibility was a revelation. We went to nearly a dozen buildings, and at each one the leasing agents knew who he was; and, he had obvious command of their respect. We had heard stories about brokers, but neither one of us can imagine what we would have done without Jose by our sides. We are so grateful for his professional guidance and will definitely utilize the Jose Medina Team again.', 38, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(151, 'It was a pleasure dealing with Ediss Construction for our home remodeling project. Thank you for the quality hard work.', 41, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(152, 'Had our commercial kitchen installed by the PKI Group. Great group of guys, they were very professional and made some modifications to improve the setup. I will definitely recommend.', 20, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(153, 'Quality and professional spray tanning. Worth every penny. I will definitely use you again.', 50, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(154, 'Great experience with FIC Insurance. We recently had a flood and the team at their office made sure everything was covered by our insurance policy. Always professional and will recommend.', 25, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(155, 'Was pleasantly suprised at how courteous your employees were, and that all of our furniture and file cabinets were moved and relocated here in Weston without incurring any damage. When you consider the fact that we had furnishings for six offices, plus a conference room and about a dozen file cabinets, and yet there were no damages. Thanks again for the great work.', 4, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(156, 'We would like to thank the staff of All States Auto Transport, they made the whole process painless. Angie was great to work with and was easy to reach and keeped us informed the whole time. Andrew our delivery driver was also very courteous and pleasant to deal with, we highly recommend All State Auto to anyone needing thier services. Thanks Again. ', 18, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(157, 'Second time using Inkatan and always a good service. Thanks again and I will definitely recommend.', 50, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(158, 'Found the perfect freestanding bathtub at Tubs & More. Awesome showroom and great prices. Will definitely be back.', 55, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(159, 'Had our washing machine repaired by World Appliance. Professional and best of all at a great price. Thanks again and will recommend.', 56, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(160, 'Fast and very convenient mobile spray tanning. Cristina was very personable, arrived as scheduled and I look great. Thanks again.', 50, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(161, 'Wonderful experience with C & C Movers. They moved our condo from Aventura to Fort Lauderdale and were extremely professional. Thanks again and keep up the good work.', 6, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(162, 'Great job with our website makeover. They went over several different styles and designs and gave our website the perfect look. Professional and state of the art, we couldn\'t be happier.', 10, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(163, 'Great job installing our new roof. Dadeland Roofing was recommended and very professional. We have needed to upgrade our roof for over a year and its never looked so good. Thanks again for the hard work and getting it done before the holidays.', 30, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(164, 'Their Watermakers worked great in our environment. Quality design and fast shipping always a plus. Thanks.', 32, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(165, 'Great job at our title closing. Nationwide was our title agent and did a great job preparing everything for a smooth closing. Thanks.', 21, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(166, 'We had a new bathroom addition added to our home by ECO General Contractors. They were recommended and came in priced affordable.  The quality of the work was excellent, including the bathtub, tiling and faucets. We would recommend them to anyone needing home remodeling.', 31, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(168, 'We had a locksmith service done at our office in Coral Springs and was extremely happy with the professional service provided by Coral Springs Locksmith. No hidden fees and all around good experience.  Thanks again.', 58, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(169, 'Had a new kitchen and bedroom remodeled by ECO General Contractors last month. We consistently get compliments on the changes and we appreciate the excellent work. Thanks again.', 31, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(170, 'We had a custom commercial kitchen installation by the PKI Group. From commercial hood installations to walk in coolers, everything came out great. Thanks again.', 20, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(171, 'Had the pleasure of hiring C & C Shipping. What a great job and very professional. We look forward to our next move with you guys when we go long distance. Thanks', 6, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(173, 'Had our home locks replaced by Coral Springs Locksmith. Was recommended from a coworker and my experience was very professional and reasonably priced. Thank you and I will also be recommending you.', 58, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(174, 'Had the experience of working with Sea R.O. for a new watermaker for our company yacht. We find the unit very efficient as well as easy to replace parts as we need it. We will continue to recommend you, thanks.', 32, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(175, 'We had the pleasure of working with the PKI Group on a commercial kitchen installation in one of our Miami restaurants. Very efficient and professional. We will continue to recommend you.', 20, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(176, 'This is really nice support for small kids in the playground. I wish they would have had an extension at the back of the helmet to cover little of the neck too, but overall this is a great soft helmet for protecting the head as well as the forehead.', 59, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(177, ' We recently had an great experience with Coral Springs Locksmith. We needed to have our home locks changed on our home in Coral Springs and was suggested Medeco products for better security and it was a great choice. The locksmith was very friendly and professional. I would definitely recommend Coral Springs Locksmith for any home locksmith needs. ', 58, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(181, 'How wonderful for children to be able to choose a favorite design and customize their headgear to truly become their own..along with comfort and safety. We were worried that our son was not going to like the helmet, but now with his favorite spider design he even wants to sleep with it. ', 59, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(182, 'I really liked the guy that came out from AM Square Air Conditioning. He was very personable and I liked that he explained to me exactly what was wrong with my unit. He definitely knew what he was doing and was able to get my unit working back up at 100%. His price was about what you would expect when having your air conditioning unit serviced. All in all it was a good experience and I would definitely use AM Square again.', 60, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11');
INSERT INTO `review` (`id`, `review_description`, `office_id`, `is_active`, `created_at`, `updated_at`) VALUES
(183, 'Had a great experience on our remodel. We had a new garage addition and our a bathroom remodeled by ECO General Contractors. Great work and very professional.', 28, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(184, 'Had a great experience with our new roof installation. We found Dadeland roofing as a professional and hard working Miami roofer. Thanks.', 30, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(185, 'Excellent product. Firm and light weight. Easy to use. On top of that, the guy I was dealing with was truly supportive.', 59, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(186, 'What a difference our home looks. After having ECO General Contractors renovate our Fort Lauderdale home, we have had nothing but great comments on how modern and perfect it looks after the remodel.  We redid the floors, kitchen, bathrooms and added another walk in closet.  Thanks to Pavel and his team of professionals, we have no doubt to use him again for our remodeling projects.  Thanks. ', 28, 1, '2017-03-28 07:23:11', '2017-03-28 07:23:11'),
(187, 'Had used ECO Builders for our home remodeling projects, and as always a great experience. The materials used were of high quality and the workmanship superior.', 63, 1, '2017-04-05 09:19:31', '2017-04-05 09:19:31'),
(188, 'ECO Builders called me back immediately to discuss the job, made sure to understand what I was looking for and scheduled a time to come out and provide an estimate.  Pavel was professional and stood by his word of quality.  We agreed on a reasonable price for our home renovation and was able to start working the next week. After it was completed we were very happen with the design and quality of work, we would definitely recommend.', 63, 1, '2017-04-06 18:48:47', '2017-04-06 18:51:12'),
(197, 'Great job on our commercial roof repair.  Our restaurant had some minor leaks in the roof and Dadeland Roofers were recommended to us. They were fast and gave a good price on the repairs. Thanks again.', 30, 0, '2017-04-14 07:09:59', '2017-04-14 06:32:17'),
(198, 'Very professional and well organized. We researched a few remodeling companies and felt most comfortable with ECO Builders.  From beginning to end, we have a great experience and would definitely use them for our next project and friends.  Thanks.', 63, 1, '2017-04-14 07:15:23', '2017-04-14 06:34:48'),
(199, 'Had a great experience with Pavel. Gave us a free estimate and got the work done on our home before our agreed date.  Thanks again for the professional service.', 28, 0, '2017-04-14 07:10:53', '2017-04-14 06:36:34'),
(200, 'Excellent job remodeling our kitchen.  Thanks again and we look forward to our next project.', 31, 0, '2017-04-14 07:10:56', '2017-04-14 06:38:13'),
(201, 'Successful remodel of our restaurant in Sunny Isles.  Love the new layout and design. I will definitely use you guys to remodel our other locations. Thanks again for a great job.', 31, 0, '2017-04-14 07:10:57', '2017-04-14 06:39:02'),
(202, 'Great experience with this remodeling contractor. Very knowledgable and excellent workmanship. Helped us remodel our condo in Sunny Isles.', 31, 0, '2017-04-14 07:11:02', '2017-04-14 06:39:42'),
(203, 'Just bought a new Jeep and got a great deal on auto insurance. Very friendly office and would definitely recommend.', 25, 0, '2017-04-14 07:11:04', '2017-04-14 06:40:58'),
(205, 'Found great prices on washers & dryers. I will recommend you, thanks.', 27, 0, '2017-04-14 07:11:08', '2017-04-14 06:44:48'),
(206, 'Found a great deal on a new A/C unit at this store. Good customer service.', 27, 0, '2017-04-14 07:11:09', '2017-04-14 06:45:37'),
(207, 'Our son has epilepsy and we were very happy with the Opticool helmet we purchased.  We always had worried about our son with head injuries and now we can feel a little bit more at ease. The helmet was well constructed and very durable.', 59, 1, '2017-04-14 07:18:48', '2017-04-14 07:18:48'),
(208, 'Had a great experience with ECO Builders on our remodeling project. Quality work, fast response and well organized.  We have been looking for a quality remodeling company for several years and we are happy to have found them from a coworker. Highly recommend.', 63, 1, '2017-04-16 23:52:01', '2017-04-16 23:52:01'),
(209, 'Used ECO Builders for our commercial office renovation.  We have had our office since 1989 and have been waiting to completely renovate in order to make it more modern. Pavel came out to our office, gave us some great ideas on the design, and made a reasonable proposal.  We felt confident about his service throughout the renovation and we are extremely happy with the quality of his work.  Thank you again.', 63, 1, '2017-04-18 18:44:57', '2017-04-18 18:44:57'),
(210, 'We now recommend ECO Builders to all our friends. Had a great experience in our home remodeling projects with Pavel. Thank you for always doing a great job.', 63, 1, '2017-04-19 20:08:41', '2017-04-19 20:08:41'),
(211, 'Had a great experience with AM Square Air Conditioning.  We had a leak in our Freon and called to get them to come out to service our A/C Unit.  Great job, fast work and reliable company.', 60, 1, '2017-04-21 17:22:39', '2017-04-21 17:22:39'),
(212, 'Great company - fast response. Jean came out to our house when our A/C wasn\'t working so good.  Got our A/C fixed at a great price with a professional service. Thanks again Advance Air and we will continue to recommend you to others.', 86, 1, '2017-04-22 22:33:46', '2017-04-22 22:33:46'),
(213, 'Great job on our website.  Our original website we had for ages needed a modern look to it and we hired WW Web Design Studios. Professional, knowledgeable, and had great advise for our company to succeed on the internet. Thanks again for rebranding our company online, our website looks great.', 80, 1, '2017-04-26 15:31:32', '2017-04-26 15:31:32'),
(214, 'South Florida Van Lines was very professional.  They moved me and my mother from our Miami condo to a new home.  The team worked efficient, wrapped all the furniture and moved us under the estimated time.  Great job, thanks again for the hard work.', 43, 1, '2017-04-26 15:37:12', '2017-04-26 15:37:12'),
(215, 'We were very happy with the work. ECO General Contractors came highly recommended and was looking forward to working with them.  Our design and remodel came out better than we expected.  Thanks for the hard work and quality design you have made for our kitchen.', 83, 1, '2017-04-26 15:39:59', '2017-04-26 15:39:59'),
(216, 'An awesome Pilates studio in Harrison NY, very clean and nice. All of the instructors are very friendly and helpful. They also let you go at your own pace, while encouraging you. But you\'ll never feel forced to do what you aren\'t capable of. The workout is a great combination of strength conditioning and cardio. I\'m definitely glad I found REI Pilates.', 85, 1, '2017-04-28 17:19:34', '2017-04-28 17:19:34'),
(217, 'Did an awesome job cleaning my sofa and carpets.  Came to my house and gave me a great price to do the cleaning of my sofa and carpets in the house.  Joe took the time to clean professionally and made sure not to miss anything.  I would highly recommend this carpet cleaning company to anyone looking for quality service at a very reasonable price. Thanks, and I will always recommend you to others.', 8, 1, '2017-04-29 17:52:33', '2017-04-29 17:52:33'),
(218, 'I cannot describe how hard Linda worked on our event. She gave me inspirational ideas and is an amazing event planner to work with. Our event had over 100 people and went without any issues. We appreciate the hard work and will definitely spread the word about Diversity Events.', 97, 1, '2017-05-06 16:47:37', '2017-05-06 16:47:37'),
(219, 'I\'ve tried a few studios in the area and Rei Pilates is by far my favorite for an effective reformer workout, atmosphere, and cost. I\'d recommend a private session if you\'re new to reformer Pilates, as the group classes can get quite athletic, so expect a thorough workout. The atmosphere is superb. Both Rei and Kara have a great energy, the music keeps the classes lively and the studio is very modern with gorgeous Allegro 2 reformers. There\'s also some very cool Alo Yoga active wear for sale. Class times are convenient and the packages available make it more cost-effective than many places in the area. I recommend downloading the Mind Body app for easy booking.', 85, 1, '2017-05-16 04:05:07', '2017-05-16 04:05:07'),
(220, 'Diversity Events rock! Their work is well planned, conscientious and creative. Linda and her team are real professionals who take care of every detail required to support the success of each event.  They work with you to capture the underlying goals and vision for your event, executed within an established timeline and budget. Diversity Events reflects both passion and expertise in event management.', 97, 1, '2017-05-16 04:34:43', '2017-05-16 04:34:43'),
(221, 'Outstanding Professionals...the entire team! My condo in Sunny Isles Beach required various home improvements including painting, drywall repair, kitchen and bathroom cabinets replacement and bath tub refinishing. The project was completed on-time, without any complications!', 42, 1, '2017-05-16 15:08:00', '2017-05-16 15:08:00'),
(222, 'It was a pleasure working with Ediss Construction. My apt In Miami beach had serious flood damage. Eli and his team made it better then it was. It was never a problem for his expert workman all work was professionally done. Nothing was ever a problem.', 41, 1, '2017-05-18 14:58:07', '2017-05-18 14:58:07'),
(223, 'Great experience with South Florida Van Lines. We moved from our Miami Beach condo to our new home in Fort Lauderdale.  The four men crew was excellent, wrapped all our furniture, and got everything into our new home very efficiently.  I was surprised to see how well everything was wrapped and that they took the time to making sure no damage.  Thanks again and will definitely use you in the future.', 44, 1, '2017-05-18 15:12:38', '2017-05-18 15:12:38'),
(224, 'test', 4, 0, '2017-05-18 16:00:27', '2017-05-18 15:56:26'),
(225, 'Had a great experience with Transport Cars. Found them online and was happy to get a great price with good service. The representative was very professional and thorough about the car transport process, which was great because this was my first time using a car transport company. Overall a great experience and would call them again if I needed another service. Thanks.', 112, 1, '2017-05-19 18:00:35', '2017-05-19 18:00:35'),
(226, 'I had dirty walls painted around the whole house, multiple holes filled within my wall, a broken fence that was fixed, and completely had my yard re-done. The work was beyond my expectations and there is honestly not one bad thing i can say or think of in receiving this service. Great work and customer service.', 41, 1, '2017-05-19 18:03:56', '2017-05-19 18:03:56'),
(227, 'My skins glows every time I get the spray tan by InkaTan.  Its been a great tanning experience with Cristina and would definitely recommend.', 50, 1, '2017-05-19 18:07:45', '2017-05-19 18:07:45'),
(228, 'Our wedding anniversary went flawless.  Thanks to Linda and her experience, she lead the way to a great night. We highly recommend the team from Diversity Events and will continue to use them. Thanks again.', 97, 1, '2017-05-19 18:14:03', '2017-05-19 18:14:03'),
