(322, 'We just had our condo remodeled by ECO General Contractors. Great job, great price and very efficient.  We found them online, interviewed a couple general contractors and felt most comfortable with Pavel.  We completely gutted out our condo and now it looks like a brand new apartment. Thanks again for the good work.', 150, 1, '2018-04-06 16:49:23', '2018-04-06 16:49:23'),
(323, 'Quality work! These guys from Green Pro Cleaning know what they are doing. If you want your restaurants exhaust system grease clean and in great condition call these guys. I also love the fact that they give me pictures of their work. Thank You.', 182, 1, '2018-04-11 20:21:55', '2018-04-11 20:21:55'),
(324, 'Had a great experience with the Hair Pigment Center. I originally saw them on an issue of losing hair and found out about their hair regrowth program and was immediately hooked.  I am now after a few months no longer thinning and the area had filled in without any chemicals or pills. I will definitely recommend you guys.', 122, 1, '2018-04-11 20:25:32', '2018-04-11 20:25:32'),
(325, 'Had a great experience with Prestige Blinds on our installation for our office.  Very professional and easy to work with.  We had them price out our 8 windows from our office and were very reasonable with good quality Zebra Shades.  Thanks again and we will definitely be recommending you.', 190, 1, '2018-05-16 20:41:58', '2018-05-16 20:41:58'),
(326, 'Our new window treatments looks amazing. Prestige Blinds was recommended by our interior designer and we are very happy with the way our plantation shutters look. We find the shutters to being well constructed and are worth every penny. Thank you for doing such a good job on the installation and your attention to detail. ', 190, 1, '2018-05-18 01:49:30', '2018-05-18 01:49:30'),
(327, 'We had used them for our storefront shop glass replacement.  We were happy to find someone that could replace the glass in the same day we called. Good prices and fast service. I have saved your number and will definitely use you guys again if we need any unexpected glass replacement.', 195, 1, '2018-06-05 12:15:43', '2018-06-05 12:15:43'),
(328, 'Hired them to redesign our Moving Company\'s website.  We are very happy with the results of the website design and the way they made sure we weren\'t missing anything for our online look to being its best.  Thanks again and we already see an improvement in the bounce rate as well as conversions.', 79, 1, '2018-06-05 17:33:45', '2018-06-05 17:33:45'),
(329, 'These guys did a great job on our appliance repair service.  We were happy that they were able to fix our washer and dryer issues and at the same time resolved our issue with our refrigerator ice maker. ', 168, 1, '2018-06-05 17:58:12', '2018-06-05 17:58:12'),
(330, 'We were looking for a new IT company and found Solutiant.  We decided to engage with their Managed Service solution and what a great choice!  The transition was very smooth.  They are professional, extremely responsive, flexible with the services they can provide and strive for customer satisfaction.  I just cannot say enough good things about this company.  I will definitely refer them.', 204, 1, '2018-08-06 12:06:42', '2018-08-06 12:06:42'),
(331, 'Did a very good job.  Good follow up and very attentive.  You get real people willing and able to provide quality IT Services with your best interest in mind. They definitely knew what they were doing and took all the steps necessary to get the job done.  Will use again. ', 204, 1, '2018-08-08 01:37:44', '2018-08-08 01:37:44'),
(332, 'Had a great experience with XPO Blinds installing my Dual Shades in my home in Pompano.  We were recommended to XPO from a few coworkers and we have been happy throughout the whole process.  Our window treatments looking amazing and it was worth every penny.  Thanks again and I will definitely spread the word. ', 207, 1, '2018-08-18 00:08:17', '2018-08-18 00:08:17'),
(333, 'Had a great experience with ECO general contractors with our home remodel project including the kitchen, master bathroom and flooring.  Great pricing but most importantly excellent service.  Thanks again.', 28, 1, '2018-08-22 02:39:48', '2018-08-22 02:39:48'),
(334, 'Great experience with our washer repair.  David came out and diagnosed our washing machine and was able to get it repaired on the same visit.  We are very happy because we thought we were going to have to buy a new washer.  Thanks again D&J Appliance repair.', 168, 1, '2018-08-22 02:44:40', '2018-08-22 02:44:40'),
(335, 'Best quality restaurant furniture.  We had bought this for our new restaurant in South Florida and found a great deal at Décor N More.  Quality wood table tops, chairs and a bunch of other things we purchased there all came in a decent time frame and looks great.', 104, 1, '2018-08-22 02:49:06', '2018-08-22 02:49:06'),
(336, 'Had a great experience with John Wayne Mattress Co. purchasing our new King and Queen mattress set.  We shopped around but found their store to be the most reasonable prices for quality mattress sets.  We are very happy with our purchase and will definitely come back.', 202, 1, '2018-08-22 03:02:37', '2018-08-22 03:02:37'),
(337, 'I recently purchased 7 of these fabulous natural oak tables from you. They are beyond expectation! WE love them, thank you.', 104, 1, '2018-09-02 14:47:27', '2018-09-02 14:47:27'),
(338, 'Our Utility Trucks were in need of fiberglass repairs on the boom and several areas.  We contacted Advanced Fabrication Technologies and we found them to be very reasonably priced and the work was done professionally.  We definitely have no doubt that we will be calling you whenever we need these services again. Thank You for your help.', 209, 1, '2018-09-19 16:11:49', '2018-09-19 16:11:49');
